VALUES
	(1,2,'Free Quote Response','<table width=\"500\" align=\"center\" cellpadding=\"12\" cellspacing=\"0\" border=\"0\" style=\"width: 500px; margin: 0 auto;\">\n  <tr>\n    <td align=\"left\" style=\"padding-left: 0px; padding-right: 0px; padding-bottom: 8px;\">\n      <a href=\"{site}\">{logo}</a>\n    </td>\n    <td align=\"right\" style=\"padding-left: 0px; padding-right: 0px; padding-bottom: 8px;\">\n      <b><a style=\"font-family: Arial, sans-serif; font-size: 16pt; line-height: 16px; color: #f04241\" href=\"tel:{tel}\">{tel}</a></b>\n      <br>\n      <span style=\"font-family: Arial, sans-serif; color: #33679e; font-size: 8.25pt\">{working_hours}</span>\n    </td>\n  </tr>\n  <tr>\n    <td bgcolor=\"#264b7f\" colspan=\"2\" align=\"center\" style=\"height: 13px; padding: 8px;\">\n      <b style=\"font-family: Arial, sans-serif; color: white; font-size: 17pt\">Free Quote Response</b>\n    </td>\n  </tr>\n  <tr style=\"line-height: 20px;\">\n    <td bgcolor=\"white\" colspan=\"2\" align=\"center\" style=\"padding: 20px; color: #000000\">\n      <b style=\"font-family: Arial, sans-serif; color: #33679e\">\n        Hello <b style=\"color: #000000\">{name}</b><br><br>\n\n        Thank you for sending us a Free Quote request.<br>\n        One of our skilled Move Coordinators will call you now.<br>\n        (Or at a later time if you requested that.)\n\n        <br><br>\n        If you wish to view your Move Record click here:<br><br>\n          <a href=\"{url}/customer_move_records/{move_record_id}?token={token}\" style=\"background-color: #49bf67; border-radius: 3px; color: white; padding: 6px 12px; text-decoration: none; border-color: rgba(0, 0, 0, 0.1) rgba(0, 0, 0, 0.1) rgba(0, 0, 0, 0.25); box-shadow: inset 0 1px 0 rgba(255, 255, 255, 0.2), 0 1px 2px rgba(0, 0, 0, 0.05);\">My Move</a>\n        \n        <br><br>\n        Or visit <a href=\"{url}/customer_move_records/{move_record_id}?token={token}\" style=\"color: #000000\">{url}</a>\n      </b>\n\n\n      <br><br>\n    </td>\n  </tr>\n  <tr>\n    <td bgcolor=\"#264b7f\" colspan=\"2\" align=\"center\" style=\"padding: 8px; color: white; height: 27px;\">\n      {oomovers_owners_care}\n    </td>\n  </tr>\n  <tr>\n    <td colspan=\"2\" align=\"center\" style=\"padding: 0px;\">\n      <table cellspacing=\"0\" cellpadding=\"12\" border=\"0\" width=\"100%\">\n        <tr valign=\"middle\">\n          <td style=\"padding-left: 0px;\">\n            <span style=\"font-family: Arial, sans-serif; color: #a4a4a4; font-size: 9pt\">\n              {address}\n            </span>\n          </td>\n          <td align=\"center\" style=\"white-space: nowrap;\">\n            <a href=\"unsub\" style=\"font-family: Arial, sans-serif; color: #a4a4a4; font-size: 9pt\">Unsubscribe</a>\n          </td>\n          <td align=\"center\" style=\"white-space: nowrap;\">\n            <a href=\"{privacy_web_page}\" style=\"font-family: Arial, sans-serif; color: #a4a4a4; font-size: 9pt\">Privacy Policy</a>\n          </td>\n          <td align=\"center\" style=\"white-space: nowrap; padding-right: 0px;\">\n            <a href=\"{contact_us_web_page}\" style=\"font-family: Arial, sans-serif; color: #a4a4a4; font-size: 9pt\">Contact Us</a>\n          </td>\n        </tr>\n      </table>\n    </td>\n  </tr>\n</table>',1,1,0,0,'2015-09-22 20:53:45','2017-07-18 19:54:13',NULL),
	(3,2,'Follow up','<table width=\"500\" align=\"center\" cellpadding=\"12\" cellspacing=\"0\" border=\"0\" style=\"width: 500px; margin: 0 auto;\">\n  <tr>\n    <td align=\"left\" style=\"padding-left: 0px; padding-right: 0px; padding-bottom: 8px;\">\n      <a href=\"{site}\">{logo}</a>\n    </td>\n    <td align=\"right\" style=\"padding-left: 0px; padding-right: 0px; padding-bottom: 8px;\">\n      <b><a style=\"font-family: Arial, sans-serif; font-size: 16pt; line-height: 16px; color: #f04241\" href=\"tel:{tel}\">{tel}</a></b>\n      <br>\n      <span style=\"font-family: Arial, sans-serif; color: #33679e; font-size: 8.25pt\">{working_hours}</span>\n    </td>\n  </tr>\n  <tr>\n    <td bgcolor=\"#264b7f\" colspan=\"2\" align=\"center\" style=\"height: 13px; padding: 8px;\">\n      <b style=\"font-family: Arial, sans-serif; color: white; font-size: 17pt\">Follow up</b>\n    </td>\n  </tr>\n  <tr style=\"line-height: 20px;\">\n    <td bgcolor=\"white\" colspan=\"2\" align=\"center\" style=\"padding: 20px; color: #000000\">\n      <b style=\"font-family: Arial, sans-serif; color: #33679e\">\n        Hello <b style=\"color: #000000\">{name}</b><br><br>\n\n        Thank you for allowing us to quote, we will call you again.<br><br>\n\n        How to choose the best mover is difficult.<br>\n        Please consider the value of movers who truly care<br> \n        when you decide who you want coming into your home. <br><br>\n\n        I will call you again when you are ready to make a decision <br>\n        We want your business and will match any valid competitor.<br>\n	{account_name} would like to be your mover today and in the future.\n\n        <br><br>\n        If you wish to view your Move Record click here:<br><br>\n          <a href=\"{url}/customer_move_records/{move_record_id}?token={token}\" style=\"background-color: #49bf67; border-radius: 3px; color: white; padding: 6px 12px; text-decoration: none; border-color: rgba(0, 0, 0, 0.1) rgba(0, 0, 0, 0.1) rgba(0, 0, 0, 0.25); box-shadow: inset 0 1px 0 rgba(255, 255, 255, 0.2), 0 1px 2px rgba(0, 0, 0, 0.05);\">My Move</a>\n        \n        <br><br>\n        Or visit <a href=\"{url}/customer_move_records/{move_record_id}?token={token}\" style=\"color: #000000\">{url}</a>\n      </b>\n\n\n      <br><br>\n    </td>\n  </tr>\n  <tr>\n    <td bgcolor=\"#264b7f\" colspan=\"2\" align=\"center\" style=\"padding: 8px; color: white; height: 27px;\">\n      {oomovers_owners_care}\n    </td>\n  </tr>\n  <tr>\n    <td colspan=\"2\" align=\"center\" style=\"padding: 0px;\">\n      <table cellspacing=\"0\" cellpadding=\"12\" border=\"0\" width=\"100%\">\n        <tr valign=\"middle\">\n          <td style=\"padding-left: 0px;\">\n            <span style=\"font-family: Arial, sans-serif; color: #a4a4a4; font-size: 9pt\">\n              {address}\n            </span>\n          </td>\n          <td align=\"center\" style=\"white-space: nowrap;\">\n            <a href=\"unsub\" style=\"font-family: Arial, sans-serif; color: #a4a4a4; font-size: 9pt\">Unsubscribe</a>\n          </td>\n          <td align=\"center\" style=\"white-space: nowrap;\">\n            <a href=\"{privacy_web_page}\" style=\"font-family: Arial, sans-serif; color: #a4a4a4; font-size: 9pt\">Privacy Policy</a>\n          </td>\n          <td align=\"center\" style=\"white-space: nowrap; padding-right: 0px;\">\n            <a href=\"{contact_us_web_page}\" style=\"font-family: Arial, sans-serif; color: #a4a4a4; font-size: 9pt\">Contact Us</a>\n          </td>\n        </tr>\n      </table>\n    </td>\n  </tr>\n</table>',1,1,0,0,'2015-09-22 20:53:45','2017-04-14 20:46:32',NULL),
